displayOptions.display_template:
{% for label, id in data %}
    <a href="{{ path('emsco_dashboard', {'name': 'sitemap', 'activeItemId': id }) }}">{{ label|raw }}</a>
{% endfor %}

displayOptions.choices_template:
{% apply spaceless %}
    {% set choices = [] %}
    {% for item in items %}
        {% set path = [] %}
        
        {% for i in item.path %} 
            {% if i.type == 'section' %}
                {% set path = path|merge([i.object.label]) %} 
            {% else %}
                {% set path = path|merge([i]) %}
            {% endif %}
        {% endfor %}
        
        {% set label = path|join(' > ') %}
        {% set choices = choices|merge({ (label) : (item.id) }) %}
    {% endfor %}
{% endapply %}
{{ choices|json_encode|raw }}

extraOptions.postProcessing:
{% if finalize and _source.menu|default(false) %}
    {% set found = {
        "index": 'preview'|get_environment.alias,
        "body": {
            "query": {
                "bool": {
                    "must": [ { "terms": { "menu": [_source.menu]} } ],
                    "must_not": [ { "term": { "_id": (_id) } } ]
                }
            }
        },
    }|search.hits.hits|default([]) %}
    {% if found|length > 0 %}
        {{ cant_be_finalized('Another page has been already created for this entry. Please delete this draft.') }}
    {% endif %}
{% endif %}
